export default function ProductsArray(){

    const arr = []

    useEffect(() => {
        fetch('https://fakestoreapi.com/products/')
            .then(res=>res.json())
            .then(json=>arr.push(json))
    }, []);

    console.log(arr)
    return ProductsArray 
}
